import React from 'react'
import { Box, styled, Typography } from "@mui/material";

const Abouts = () => {
    const ContBox = styled(Box)(({theme}) => ({
        display:"flex",
        justifyContent:"space-evenly",
        gap: theme.spacing(5),
        [theme.breakpoints.down("md")]: {
            flexDirection: "column",
            alignItems: "center",
            textAlign: "center",
          },
    }));
  return (
    <Box sx={{textAlign:"center", paddingTop:"0px", paddingBottom:"30px"}}>
      <Typography
        variant="h3"
        sx={{ fontSize: "35px", fontWeight: "bold", color: "#000339", my: 2, marginBottom:"40px" }}
      >
        About Me
      </Typography>
        <ContBox>
          <Box style={{maxHeight:"400px", backgroundColor:"#f9f0ff", padding:"30px", borderRadius:"30px", fontSize:"20px", marginRight:"400px", marginLeft:"400px", marginTop:"100px", marginBottom:"100px", boxShadow:" 0 4px 8px 0 rgba(0, 0, 0, 0.3), 0 6px 20px 0 rgba(0, 0, 0, 0.19)"}}>
            <p >
              I'm Sauarbh , I've completed 3 year diploma in computer science from feroze gandhi polytechnic raebareli with 77 percentile in 2021 after that i've joined a 6 month full stack web development training from edyoda technologies banglore, and made many projects and Now I want to join a company to show my skills...<br/>
            </p>
          </Box>
        </ContBox>
    </Box>
  )
};

export default Abouts
